import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Instructions from './pages/Instructions';
import Task1 from './pages/Task1';
import Task2 from './pages/Task2';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/instructions/:index" element={<Instructions />} />
        <Route path="/task1/:index" element={<Task1 />} />
        <Route path="/task2/:index" element={<Task2 />} />
        <Route path="/task3" element={<div>Task3</div>} /> {/* Placeholder for Task3 */}
        <Route path="/task2errore" element={<div>Task2 Errore</div>} /> {/* Placeholder for Task2 Errore */}
      </Routes>
    </Router>
  );
};

export default App;
